import React, { Component } from "react";
import {
  View,
  Text,
  Image,
  StyleSheet,
  TouchableOpacity,
  Dimensions
} from "react-native";
import { styles } from '../../App'

import FlatText from '../components/FlatText';

const Settings = () => {
  return (
    <View style={styles.container}>
          <Text>Settings Screen</Text>
                    {/* <FlatText color='#000' textalign='center' text="Settings screen" font="q_regular" size={22} /> */}
    </View>
  )
}


export default Settings
